    false,nt"url": null,nt"notes": "This report summarizes the results of 11
    vegetative transects conducted in July and August, 1976 at Clarence Cannon NWR.
    The tracts completed included millet ponds A, B, and C; goose pasture, headquarters
    marsh; supply pond; big pond; and fields 4A, 4B, 21, and 22. The purpose of this
    study was to determine the plant composition and evaluate the relative abundance
    of the prominent plant species. Each plant species was ranked and categorized as
    to (a) the number of plot sites it occurred on; (b) what percentage of the total
    sites it was found on; (c) total vegetation; and (d) what percentage of the total
    vegetative yield this would be for each site.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
